import React from 'react';
import Navbar from './static/navbar';
import HomeBanner from './static/homebanner';
import './App.css';

function App() {
  return (
    <react-fragment>    
        <Navbar/>
        <HomeBanner/>
    </react-fragment>
  );
}

export default App;
